/* eslint no-unused-vars: 0 */
import ifDefined from '@ui5/webcomponents-base/dist/renderer/ifDefined.js';
import { html, svg, repeat, classMap, styleMap } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';
const block0 = (context) => { return html`${ context.displayValueStateMessagePopover ? block1(context) : undefined }`; };
const block1 = (context) => { return html`<ui5-popover		skip-registry-update		no-padding		no-arrow		_disable-initial-focus		class="ui5-valuestatemessage-popover"		style="${styleMap(context.styles.valueStateMsgPopover)}"		placement-type="Bottom"		horizontal-align="Left"	><div slot="header" class="ui5-valuestatemessage-root ${classMap(context.classes.valueStateMsg)}">			${ context.hasCustomValueState ? block2(context) : block4(context) }</div></ui5-popover>`; };
const block2 = (context) => { return html`${ repeat(context.valueStateMessageText, (item, index) => item._id || index, (item, index) => block3(item, index, context)) }`; };
const block3 = (item, index, context) => { return html`${ifDefined(item)}`; };
const block4 = (context) => { return html`${ifDefined(context.valueStateText)}`; };

export default block0;
